import React, { Component } from 'react'
import './Content.css'

export default class Content extends Component {
  render() {
    return (
      <div className='list'>
        <ul>
          <li className='list-item'>打代码</li>
          <li className='list-item'>睡觉</li>
          <li className='list-item'>吃饭</li>
        </ul>
      </div>
    )
  }
}
